import React, { useEffect, useState } from 'react';

const useGetCardData = () => {
    const [count, setCount] = useState(0);
    const [fries, setFries] = useState(0);
    const [coke, setCoke] = useState(0);

    return {
        count,
        fries,
        coke,
        setCount,
        setFries,
        setCoke
    }
}

export default useGetCardData;
